import React, { useContext } from 'react';
import { Link } from 'react-router-dom';
import { AuthContext } from '../context/AuthContext';
import './Naglowek.css';

const Naglowek = () => {
  const { user, logout } = useContext(AuthContext);

  return (
    <nav className="navbar">
      <h1><Link to="/">Braid Hair Glamour</Link></h1>
      <ul>
        {user ? (
          <>
            <li><Link to="/konto">Moje Konto</Link></li>
            <li><Link to="/rezerwacje">Zarezerwuj Wizytę</Link></li>
            <li><Link to="/wiadomosci">Wiadomości</Link></li>
            <li><button onClick={logout}>Wyloguj się</button></li>
          </>
        ) : (
          <>
            <li><Link to="/">Logowanie/Rejestracja</Link></li>
            <li><Link to="/kontakt">Kontakt</Link></li>
          </>
        )}
      </ul>
    </nav>
  );
};

export default Naglowek;
